import ActionBar from './ActionBar'; // Import the ActionBar component

const StudentRow = () => {
  return (
    <tr>
      <td>Claire</td>
      <td>
        <ActionBar 
          onUploadClick={() => {/* Handle upload click */}}
          onRecordClick={() => {/* Handle record click */}}
          onCalendarSyncClick={() => {/* Handle calendar sync click */}}
          onEmailClick={() => {/* Handle email click */}}
          onDownloadClick={() => {/* Handle download click */}}
        />
      </td>
    </tr>
  );
};

export default StudentRow;
